package Longest_common_subsequence;

/**
 *
 * @author ElizabethReed PC
 */
public class Longest_common_subsequence {
    
    static int[] lengths = {10,15,20,100,1000,10000};
        
    static String[] strings1 = new String[6];
    static String[] strings2 = new String[6];
    
    static Dynamic LCS = new Dynamic();
    static BruteForceAlt BF = new BruteForceAlt();
    static Timer TM = new Timer();



    /**
     * @param args the command line arguments
     */
    public static void main(String[] args) {
        
        String ex = "ABCD";
        String ex2 = "ACBD";
        
        
        strings1[0] = "AGGCAGATGT";
        strings2[0] = "GGACGGCCCC";
        
        strings1[1] = "TGTCAGCGTCGTCTG";
        strings2[1] = "GCAGTAAGGCCACCG";
        
        strings1[2] = "TGGGGTTTGAGCAAGTTCGG";
        strings2[2] = "CTACGTGTCGCTGGTCCACG";
        
        strings1[3] = "AGAGTGCTTACTCAAGTCCGCGCTCTCTCACAAATCGCCACCGCTGCTGCACCAGTCCCACGTATGCCCCAAGCCCCTAGTGTAGGGCTCCATGGAAATG";
        strings2[3] = "AGTCCAGACGCCCCCGGCCACGCACCTGCATTCTTCGGAGTTGATCTCCCCGCCTGGCTCCGGCGGCGCCGGGGGGATGATCCAGCCTCTCTTGGAGGGT";
        
        strings1[4] = "";
        strings2[4] = "";
        
        strings1[5] = "";
        strings2[5] = "";
        
        for (int i = 0; i < 6; i++) {
            benchmark(i);
        }
        
    }
    
    public static void benchmark(int i) {
        System.out.println();
        System.out.println("-----------------------------");
        System.out.printf("Beginning Benchmark for n = %d:\n", lengths[i]);
        System.out.println("------------------------------");
        System.out.println();

        if (i < 3) {
            System.out.println("Beginning Bruteforce");
            TM.start();
            BF.bruteForceLCS(strings1[i], strings2[i]);
            TM.stop();
            System.out.printf("Ran in time %10dns\n\n", TM.read());
        } else {
            System.out.println("Skipping Bruteforce");
        }
        
        System.out.println("Beginning Dynamic");
        TM.start();
        LCS.dynamicLCS(strings1[i], strings2[i]);
        TM.stop();
        System.out.printf("Ran in time %10dns\n", TM.read());
    }
    
}
